class MeasureCmd():
    def __init__(self):
        super(MeasureCmd,self).__init__()

    def GetResources(self):
        return {"MenuText": "Measure",
                "ToolTip": "Attach a Datum object in the assembly to a Datum in a linked Part",
                "Pixmap" : os.path.join( Asm4.iconPath , 'Asm4_Measure.svg')
                }

    def IsActive(self):
        if App.ActiveDocument:
            return True
        return False

    def Activated(self):
        Gui.Control.showDialog( MeasureUI() )




